INSERT INTO `config_info` VALUES (59, 'financia-app-senta-dev.yml', 'DEFAULT_GROUP', 'spring: \n  redis:\n    host: 52.77.239.103\n    port: 6379\n    password: fbetapk5\n    database: 2\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,wall,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://52.77.239.103:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: ry-cloud\n            password: dCPbmdjC8GKZXtCF\n          # seata_order数据源\n          order:\n            url: jdbc:mysql://52.77.239.103:3306/seata_order?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            username: seata_order\n            password: seata_order\n          # seata_account数据源\n          account:\n            url: jdbc:mysql://52.77.239.103:3306/seata_account?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            username: seata_account\n            password: seata_account\n          # seata_product数据源\n          product:\n            url: jdbc:mysql://52.77.239.103:3306/seata_product?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            username: seata_product\n            password: seata_product\n      seata: true   \n       #开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n\n# seata配置\nseata:\n  enabled: true\n  # Seata 应用编号，默认为 ${spring.application.name}\n  application-id: seata-server\n  # Seata 事务组编号，用于 TC 集群名\n  tx-service-group: my-tx-group\n  # 关闭自动代理\n  enable-auto-data-source-proxy: false\n  # 服务配置项\n  service:\n    # 虚拟组和分组的映射\n    vgroup-mapping:\n        my-tx-group: seata-server\n    grouplist:\n      seata-server:  54.169.76.123:8091  \n  config:\n    type: file\n  registry:\n    type: file \n\n\n# mybatis配置\nmybatis:\n    # 搜索指定包别名\n    typeAliasesPackage: com.financia.*\n    # 配置mapper的扫描，找到所有的mapper.xml映射文件\n    mapperLocations: classpath:mapper/**/*.xml\n\n# swagger配置\nswagger:\n  title: Test模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n', '460b8eeba6f3fe5abd6e9db72cec80b2', '2022-07-11 19:44:20', '2022-08-30 14:14:01', 'nacos', '92.98.24.42', 'financia-app', 'financia-app', '系统模块', '', '', 'yaml', '', '');
