INSERT INTO `config_info` VALUES (250, 'xxl-exchange-dev.yml', 'DEFAULT_GROUP', 'spring:\n  # redis\n  redis:\n    database: 0\n    host: 52.77.239.103\n    port: 6379\n    password: fbetapk5\n    timeout: 6000ms\n    lettuce:\n      pool:\n        max-active: 1000\n        max-wait: -1ms\n        max-idle: 10\n        min-idle: 5\n  # mongodb\n  data:\n    mongodb: \n      database: database\n      uri: mongodb://bizzan123:bizzan123@18.140.68.97:23561/database\n  # rabbitmq\n  rabbitmq:\n    host: 18.142.229.189\n    port: 5672\n    username: trade11\n    password: mA03ZopN7o\n    # 确认消息已发送到交换机(Exchange)选择确认类型为交互\n    # NONE值是禁用发布确认模式，是默认值\n    # CORRELATED值是发布消息成功到交换器后会触发回调方法\n    # 老版本用：publisher-confirms: true\n    publisher-confirm-type: correlated\n    # 开启消息是否到达队列的回调\n    publisher-returns: true\n    listener:\n      simple:\n        acknowledge-mode: manual\n        # 抛出异常时，才会重试\n        retry:\n          # 开启重试\n          enabled: true\n          # 最大重试次数\n          max-attempts: 2\n          # 初始重试时间间隔\n          initial-interval: 2000\n          # 应用于上一重试间隔的乘数\n          multiplier: 5\n          # 最大重试时间间隔\n          max-interval: 20000\n        # 发送异常时是否重回队列\n        default-requeue-rejected: false\n  datasource:\n    timeBetweenEvictionRunsMillis: \'60000\'\n    minIdle: \'5\'\n    maxActive: \'200\'\n    filters: stat,wall,log4j\n    maxPoolPreparedStatementPerConnectionSize: \'20\'\n    testWhileIdle: \'true\'\n    minEvictableIdleTimeMillis: \'300000\'\n    url: jdbc:mysql://52.77.239.103:3306/ry-cloud?characterEncoding=utf-8&serverTimezone=GMT%2B8&useSSL=false\n    username: ry-cloud\n    password: dCPbmdjC8GKZXtCF\n    validationQuery: \'SELECT 1 \'\n    type: com.alibaba.druid.pool.DruidDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    maxWait: \'60000\'\n    initialSize: \'5\'\n    poolPreparedStatements: \'true\'\n    testOnBorrow: \'false\'\n    testOnReturn: \'false\'\nmybatis-plus:\n  # 配置mapper的扫描，找到所有的mapper.xml映射文件\n  mapperLocations: classpath*:mapper/**/*Mapper.xml\n  configuration:\n    # sql日志输出\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n### xxl-job\nxxl:\n  job:\n    admin:\n      addresses: http://127.0.0.1:8051/xxl-job-admin\n    accessToken: default_token\n    executor:\n      appname: xxl-exchange\n      address:\n      ip:\n      port: 9996\n      logpath: /data/applogs/xxl-job/jobhandler/exchange\n      logretentiondays: 30', '5d6d1639a5724d3729c7bc19168a9ee8', '2022-08-07 07:34:34', '2022-09-04 07:37:44', 'nacos', '92.98.24.42', 'financia-xx-job', 'financia-xx-job', '', '', '', 'yaml', '', '');
