INSERT INTO `his_config_info` VALUES (207, 399, 'financia-app-swap-dev.yml', 'DEFAULT_GROUP', 'financia-app', '# spring配置\nspring: \n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n  redis:\n    host: 52.77.239.103\n    port: 6379\n    password: fbetapk5\n  rabbitmq:\n    host: 18.142.229.189\n    port: 5672\n    username: trade11\n    password: mA03ZopN7o\n  # mongodb\n  data:\n    mongodb: \n      database: database\n      uri: mongodb://bizzan123:bizzan123@18.140.68.97:23561/database\n  kafka:\n    producer:\n      linger: \'1\'\n      batch:\n        size: \'256\'\n      retries: \'0\'\n      buffer:\n        memory: \'1048576\'\n    consumer:\n      concurrency: \'9\'\n      enable:\n        auto:\n          commit: \'false\'\n      session:\n        timeout: \'15000\'\n      group:\n        id: default-group\n      auto:\n        commit:\n          interval: \'100\'\n        offset:\n          reset: earliest\n      maxPollRecordsConfig: \'50\'\n    bootstrap-servers: 18.142.229.189:9092\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://52.77.239.103:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: ry-cloud\n            password: dCPbmdjC8GKZXtCF\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n      # seata: true    # 开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n\n# seata配置\nseata:\n  # 默认关闭，如需启用spring.datasource.dynami.seata需要同时开启\n  enabled: false\n  # Seata 应用编号，默认为 ${spring.application.name}\n  application-id: ${spring.application.name}\n  # Seata 事务组编号，用于 TC 集群名\n  tx-service-group: ${spring.application.name}-group\n  # 关闭自动代理\n  enable-auto-data-source-proxy: false\n  # 服务配置项\n  service:\n    # 虚拟组和分组的映射\n    vgroup-mapping:\n      ruoyi-system-group: default\n  config:\n    type: nacos\n    nacos:\n      serverAddr: 54.169.76.123:8848\n      group: SEATA_GROUP\n      namespace:\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 54.169.76.123:8848\n      namespace:\n\n# mybatis配置\nmybatis:\n  # 搜索指定包别名\n  typeAliasesPackage: com.financia.*\n  # 配置mapper的扫描，找到所有的mapper.xml映射文件\n  mapperLocations: classpath:mapper/**/*.xml\nmybatis-plus:\n  type-enums-package: com.financia.*\n  configuration:\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler\n\n\n# swagger配置\nswagger:\n  title: 合约模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip', '16d116de8c43862b032e23d5d35f84ff', '2022-09-21 22:02:51', '2022-09-21 14:02:51', 'nacos', '43.135.3.52', 'U', 'financia-app', '');
