n            - Path=/markets/**\n          filters:\n            - StripPrefix=0   \n        # app汇兑模块\n        - id: financia-app-conversion  \n          uri: lb://financia-app-conversion  \n          predicates:\n            - Path=/app-conversion/**\n          filters:\n            - StripPrefix=1 \n        # app量化理财 \n        - id: financia-app-quantitative  \n          uri: lb://financia-app-quantitative  \n          predicates:\n            - Path=/app-quantitative/**\n          filters:\n            - StripPrefix=1\n        # app行情\n        - id: financia-app-quotes \n          uri: lb://financia-app-quotes\n          predicates:\n            - Path=/quotes/**\n          filters:\n            - StripPrefix=1   \n        # app端超级杠杆模块\n        - id: financia-app-super-leverage\n          uri: lb://financia-app-super-leverage\n          predicates:\n            - Path=/app-super-leverage/**\n          filters:\n            - StripPrefix=1 \n        # app端币币交易模块\n        - id: financia-app-currency-trading\n          uri: lb://financia-app-currency-trading\n          predicates:\n            - Path=/app-currency-trading/**\n          filters:\n            - StripPrefix=1         \n  \n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: false\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/code\n      - /auth/business\n      - /auth/register\n      - /csrf\n      - /code/test/string\n      - /app-exchange/*/*\n      - /app-websock/*\n      - /app-common/notice/list\n      - /app-common/member/register/*\n      - /app-common/member/login\n      - /app-common/member/userNameRegister\n      - /app-common/member/phoneRegister\n      - /app-common/member/emailRegister\n      - /app-common/member/back/*\n      - /app-common/syscountrycode/list\n      - /app-common/doc.html\n      - /app-swap/*\n      - /app-swap/*/*\n      - /app-swap/*/*/*\n      - /app-swap/*/*/*/*\n      - /markets/*\n      - /markets/*/*\n      - /markets/*/*/*\n      - /markets/*/*/*/*\n      - /app-conversion/*\n      - /app-conversion/*/*\n      - /app-conversion/*/*/*\n      - /app-quantitative/quantitative/home/list\n      - /app-quantitative/quantitative/info\n      - /app-quantitative/quantitative/listPage\n      - /financia-app-quotes/*\n      - /financia-app-quotes/*/*\n      - /financia-app-quotes/*/*/*\n      - /app-super-leverage/*\n      - /app-super-leverage/*/*\n      - /app-super-leverage/*/*/*\n      - /app-super-leverage/*/*/*/*\n      - /app-currency-trading/*\n      - /app-currency-trading/*/*\n      - /app-currency-trading/*/*/*\n      - /app-currency-trading/*/*/*/*\n      \n      ', '42db4e47e3a2f50cf19fbcb411744381', '2022-09-23 16:00:01', '2022-09-23 08:00:02', 'nacos', '127.0.0.1', 'U', 'financia-app', '');
